import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import logo from './imagenes/logos/logo-rectagular.png'
import CatalogoLocaciones from './componentes/CatalogoLocaciones';
import Menu from './componentes/Menu';


function App() {

  return (
    <header className="header">
      <div className='logo-contenedor'>
        <img
          src={logo}
          className='logo'
          alt='logo del proyecto' 
        />
      </div>
      <Router>
        <Menu />

        <Routes>
          <Route path="/" element={''} />
          <Route path="/catalogo" element={<CatalogoLocaciones />} />
          {/* Agrega aquí más rutas para las secciones de tu página web */}
        </Routes>
      </Router>
    </header>
  );
}


export default App;
